import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Link, Switch, useHistory } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import './App.css';
import AddCar from './AddCar';
import EditCar from './EditCar';

function App() {
    const [data, setData] = useState([]);
    const history = useHistory();

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = () => {
        fetch('http://localhost:25000/data')
            .then(response => response.json())
            .then(data => setData(data))
            .catch(error => console.error("Erro ao buscar os dados:", error));
    };

    const handleDelete = (id) => {
        fetch(`http://localhost:25000/data/${id}`, {
            method: 'DELETE',
        })
        .then(() => fetchData()) // Atualiza a lista após deletar
        .catch(error => console.error("Erro ao deletar o carro:", error));
    };

    return (
        <div className="App">
            <h1>Car List</h1>
            <button onClick={() => history.push('/add')}>Incluir Carro</button>
            <table>
                <thead>
                    <tr>
                        <th>Modelo</th>
                        <th>Marca</th>
                        <th>Ano</th>
                        <th>Categoria</th>
                        <th>Disponibilidade</th>
                        <th>Ações</th>
                    </tr>
                </thead>
                <tbody>
                    {Array.isArray(data) && data.map(car => (
                        <tr key={car.id}>
                            <td>{car.modelo}</td>
                            <td>{car.marca}</td>
                            <td>{car.ano}</td>
                            <td>{car.categoria}</td>
                            <td>{car.disponibilidade ? 'Disponível' : 'Indisponível'}</td>
                            <td>
                                <button onClick={() => history.push(`/edit/${car.id}`)}>Editar</button>
                                <button onClick={() => handleDelete(car.id)}>Excluir</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default App;
